import React from 'react';
import styled from 'styled-components';

const HappendIssueContainer = styled.div`
    height: 1143px;
    background-color: #fccb05;
`;

const HappendIssue = () => {
    return (
        <>
            <HappendIssueContainer>
                <HappendIssueHeader>
                    <h2></h2>
                </HappendIssueHeader>
            </HappendIssueContainer>
        </>
    )
}

export default HappendIssue
